INSERT INTO metadata (id, created, modified, uid, status, entity_id, entity_type, entity_uid, name, value) VALUES (3872,'2014-12-29 17:00:32','2014-12-29 17:00:32','UN2JVE5AVPBO',1,264,'DC','GCGOHO6JCVYE','wikiDoc','The home category contains items that might be found in or be associated with a home.\n\nProfile items for electrical devices have their kgCO,,2,,calculated using the emission factor for the country specified in the metadata profile item,defaulting to the UK if not specified. The electricity emission factors for all countries and regions are in the [[Electricity_by_country|/home/energy/electricity]] category.');
