INSERT INTO metadata (id, created, modified, uid, status, entity_id, entity_type, entity_uid, name, value) VALUES (3324,'2014-12-29 16:42:58','2014-12-29 16:42:58','ARNYMBLFSTY7',1,197,'DC','YG8K51UPXPNQ','wikiDoc','The AMEE category /business/waste contains data and methodologies for calculating greenhouse gas emissions associated with waste disposal. The following subcategories are avaliable:\n\n==Steady state landfill emissions\n\nThe AMEE category [[Waste_steady_state|/business/waste/steadyState]] includes data for the emission of methane from landfill assuming that emissions have acheived equilibrium with a constant waste deposition rate. Users must specify the deposition rate and the time since waste depositon began. User can additional specify several other parameters which describe the conversion of waste into methane,with defaults values available otherwise.\n\n==Landfill emissions based on methane recovery==\n\nThe AMEE category at [[Landfill_emissions_based_on_methane_recovery|/business/waste/recovery]] includes a methodology for the estimation of methane emissions from landfill,based on the practice of of methane collection and associated measures of collection efficiency and methane concentration. Users may specify their own parameters or use GHGP defaults.\n\n==Biological waste disposal methods==\n\nThe AMEE category [[Biological_waste_treatment|/business/waste/bio]] contains data and a methodology sourced from the IPCC [[http://www.ipcc-nggip.iges.or.jp/public/2006gl/pdf/5_Volume5/V5_4_Ch4_Bio_Treat.pdf|Guidelines for National Greenhouse Gas Inventories]] for calculating greenhouse gas emissions from the biological treatment of organic wastes. Emissions of both CH,,4,,and N,,2,,O emissions are covered in association with the waste treatment processes of composting and anaerobic digestion.\n\n==Waste combustion==\n\nThe AMEE category [[Combustive_waste_treatment|/business/waste/combustion]] contains data and methodologies sourced from the IPCC [[http://www.ipcc-nggip.iges.or.jp/public/2006gl/pdf/5_Volume5/V5_5_Ch5_IOB.pdf|Guidelines for National Greenhouse Gas Inventories]] for calculating greenhouse gas emissions associated with the burning of waste. Municipal and industrial contexts are represented together with numerous burning technologies.\n\n==Waste water==\n\nThe AMEE category [[Waste_water|/business/waste/water]] contains data and methodologies for calculating greenhouse gas emissions associated with waste water,sourced from the IPCC [[http://www.ipcc-nggip.iges.or.jp/public/2006gl/pdf/5_Volume5/V5_6_Ch6_Wastewater.pdf|Guidelines for National Greenhouse Gas Inventories]] and the [[http://www.epa.gov/climatechange/emissions/archived/downloads/tsd/TSD%20wastewater_020409.pdf|EPA]] mandatory reporting guidelines. Both domestic and industrial contexts are represented,with treated and untreated waste water emissions covered.\n');
